import React from 'react'
import './FollowersCard.css'

import { Followers } from '../../Data/FollowersData'

const FollowersCard = () => {
    return (
        <div className="div FollowersCard">
            <h3>Who is following you</h3>

            {Followers, map}
        </div>
    )
}

export default FollowersCard
